import React from 'react'
import Item from '../showcase/Item'
import './css/LargeContainer.css'

export default function LargeProjectContainer({ image, imageBackgroundColor, imageDirection, title, year, url, descript, languages }) {
    const item = <Item
        image={image}
        url={url}
        width={'50%'}
        backgroundColor={imageBackgroundColor}
    ></Item>
    const description = <div id="description-wrapper">
        <h1 id="project-title">{title}</h1>
        <h1 id="year">{year}</h1>
        <p id="descript">{descript}</p>
        <p id="l">{languages}</p>
    </div>
    return (
        <div className="large-project-container-wrapper">
            {imageDirection === 'left' ? {item, description} : {description,item}}

        </div>
    )
}
